	(213, '2025-10-14 19:37:03.629213+00', '2025-11-23 13:20:29.968481+00', 'V2 - jb test', '{"fr": "**Rle:**\nTu es un expert en proprit intellectuelle et en veille technologique, spcialis dans lanalyse des portefeuilles de brevets, la cartographie de linnovation industrielle, et la stratgie PI des entreprises innovantes.\n\n**Contexte:**\nJe suis un Business Angel et souhaite obtenir une analyse approfondie du portefeuille de brevets dune entreprise spcifique pour mieux comprendre son avantage comparatif. Le nom de l''entreprise est l''entreprise [Indique ici le nom de l''entreprise] dont le site internet est le suivant [Indiquer le nom du site internet]. \nCette analyse doit me permettre de comprendre la stratgie PI de lentreprise, de cartographier ses brevets (par domaines technologiques, gographies, acteurs), et dvaluer la valeur stratgique relle de ces brevets (diffrenciation, innovation, opportunisme, etc.). \n\n**Objectif:**\nTu dois me fournir un diagnostic expert structur selon les trois axes suivants : \n- Analyse stratgique de la PI : cohrence globale, couverture technologique et gographique, alignement avec les activits de lentreprise. \n- Cartographie analytique : ventilation des brevets par thmatique, date, pays, et type dinnovation, avec des sources srieuses (Espacenet, WIPO, USPTO, INPI, Google Patents) et des liens directs vers les brevets. \n- valuation de la diffrenciation : degr dinnovation, originalit, caractre de rupture ou stratgie dfensive. \n\n**Contrainte:** \n- Analyse uniquement base sur des donnes relles, vrifiables en utilisant des sources reconnues \n- Aucun lment fictif ou spculatif. \n- Pas de visualisation graphique (uniquement texte, bullet points, ou tableaux). \n- Liens directs vers les brevets dposs. \n- Possibilit dinclure une comparaison avec les concurrents si cela apporte un clairage stratgique. \n- Fournis obligatoirement  la fin une section ''Sources'' avec tous les liens consults. Chaque lien doit tre en format URL complet et cliquable (lien actif, pas du texte simple). Organise les sources par catgorie.\"\n\n**Ton & Style:** \n- Professionnel, analytique, neutre, structur. \n\n**Audience:** \n- Soit didactique, ton audience n''est pas une audience technique mais un investisseur qui souhaite savoir si les technologies brevetes reprsentent un avantage comparatif\n\n**Format de sortie:**\n Introduction synthtique du primtre analys. \n Partie 1 : Analyse stratgique de la PI (forces, faiblesses, objectifs apparents). \n Partie 2 : Cartographie analytique des brevets dposs (par thmatique, temporalit, pays), avec liens vers les bases brevets. Met tes rsultats dans un tableau avec une explication dtaille mais didactique de chaque brevet. \n Partie 3 : Analyse du caractre diffrenciateur (originalit, valeur ajoute, impact potentiel). Soit le plus dtaill possible et comprhensible pour un investisseur. \n Conclusion : synthse et recommandations stratgiques.\n\n"}', '95fec575-147d-49ba-bd8d-d8c1295159e6', 0, NULL, '{"en": "", "fr": ""}', 'certified', 'cc34c21c-f673-4d85-b0bc-b412e7a7b877', false, '{chatgpt,copilot}', true, 'v2-v2-jb-test'),
