	(18, '2025-09-16 15:43:55.64655+00', '2025-11-23 07:26:51.70446+00', '1', '{"en": "Je souhaite raliser un audit marketing complet de l''entreprise : [Indiquer le nom de l''entreprise  Auditer]\n\nUtilise ta fonction de recherche web pour me fournir des informations fiables, prcises et rcentes, organises selon les sections ci-dessous.\n\nPour chaque information, cite ta source avec un lien hypertexte direct.\n\n DIRECTIVES SUR LES SOURCES\n\nPrivilgie les sources officielles : site web de l''entreprise, rapports dactivit, communiqus de presse officiels.\nUtilise des cabinets de conseil reconnus (McKinsey, BCG, Bain, Gartner, etc.) pour les tendances du march.\nPrends en compte les analyses financires fiables (Bloomberg, Financial Times, Reuters, etc.)\nPrfre des tudes de march sectorielles rcentes (moins de 12 mois).\nNutilise pas Wikipdia comme source principale (seulement comme point de dpart si ncessaire).\nVrifie la cohrence des informations entre plusieurs sources.\n\n\n\n STRUCTURE ATTENDUE\n\n Analyse de la stratgie marketing actuelle\n\nAnalyse comment lentreprise se positionne sur son site web et ses canaux de communication officiels.\n\nObserve le ton, les messages cls, la proposition de valeur, la cible prioritaire et les leviers marketing visibles (ex : SEO, SEA, rseaux sociaux, branding).\nAppuie ton analyse sur des exemples prcis, avec des liens directs vers les sources (site officiel, pages LinkedIn, publications, etc.).\nSi certains lments manquent ou sont peu visibles, indique-le clairement.\n\n\n\n Forces internes principales\n\nQuels sont les atouts majeurs de [Nom de lentreprise] en termes de produit, service, image de marque, organisation, etc. ?\n\n\n\n Faiblesses internes principales\n\nQuelles sont les principales limitations ou faiblesses identifies actuellement ?\n\n\n\n Opportunits de march\n\nQuelles sont les opportunits externes actuelles ou mergentes que [Nom de lentreprise] pourrait saisir ?\n\n\n\n Menaces de march\n\nQuelles sont les principales menaces dans lenvironnement externe ?\n\n\n\n Tendances sectorielles cls\n\nQuelles sont les tendances actuelles et  venir du secteur d''activit de [Nom de lentreprise] ?\n\n\n\n Principaux concurrents\n\nIdentifie 3  5 concurrents directs et indirects majeurs, avec un rsum rapide de leur positionnement.\n\n\n\n SYNTHESE STRATEGIQUE : DIRECTIVES MARKETING RECOMMANDEES\n\nDresse une synthse en 5  7 points des grandes lignes d''actions marketing recommandes pour [Nom de lentreprise].\n\n\n\nBase-toi sur lanalyse SWOT ralise.\n\n\n\nPropose des orientations concrtes : dveloppement produit, communication, amlioration de loffre, stratgies de diffrenciation, ciblage, expansion march\n\nRdige chaque directive de manire claire, actionnable et priorise.\n\n\n\n PRSENTATION ATTENDUE\n\nOrganise ta rponse avec des puces, des sparations nettes et des emojis pour chaque section.\nUtilise un style visuellement clair et engageant.\nCite systmatiquement la source de chaque information avec un lien hypertexte direct.\nTermine par une liste complte des sources utilises\n\n\n\n Directive importante\n\nSi une section est incomplte ou manque dinformations fiables, indique-le clairement et propose de continuer lanalyse ou de prciser la recherche.", "fr": "Utilise ta fonction de recherche web pour me fournir des informations fiables, prcises et rcentes, organises selon les sections ci-dessous.\n\nPour chaque information, cite ta source avec un lien hypertexte direct.\n\n DIRECTIVES SUR LES SOURCES\n\nPrivilgie les sources officielles : site web de l''entreprise, rapports dactivit, communiqus de presse officiels.\nUtilise des cabinets de conseil reconnus (McKinsey, BCG, Bain, Gartner, etc.) pour les tendances du march.\nPrends en compte les analyses financires fiables (Bloomberg, Financial Times, Reuters, etc.)\nPrfre des tudes de march sectorielles rcentes (moins de 12 mois).\nNutilise pas Wikipdia comme source principale (seulement comme point de dpart si ncessaire).\nVrifie