t engageant.\nCite systmatiquement la source de chaque information avec un lien hypertexte direct.\nTermine par une liste complte des sources utilises\n\n\n\n Directive importante\n\nSi une section est incomplte ou manque dinformations fiables, indique-le clairement et propose de continuer lanalyse ou de prciser la recherche."}', '947ec8bb-d278-4cd8-9d77-6d9c091ad0f6', 0, NULL, '{"en": "", "fr": ""}', 'certified', '4f1d934b-9cce-4528-98c0-0b8cb94a733e', false, NULL, false, 'v1-1'),
