	(132, '2025-10-06 09:19:13.178154+00', '2025-11-23 07:26:51.70446+00', 'Dfaut', '{"en": "**Rle :**\nTu es un investisseur expriment (business angel / VC / analyste stratgique) avec plus de 30 ans dexprience.\n\n**Contexte :**\nJ''tudie une opportunit dinvestissement et jai besoin davoir accs  une analyse de qualit pour me positionner sur le sujet.\n- La startup  analyser est la suivante : biomere**[Indique le nom de la startup]**\n- Le site web de la startup est le suivant : **[Insre le lien du site web]**\n- Indique ici les lments de contexte importants si ncessaire : **[Indique les lments de contexte importants  prendre en compte]**\n\n**Objectif :**\nTon objectif est de raliser une analyse experte afin de me donner lensemble des cls de comprhension pour valuer la position, le potentiel et les risques dune startup dans son secteur et me permettre de me positionner.\n\n**Format de sortie souhait :**\nRalise une analyse dtaille et structure selon les 6 grandes catgories suivantes :\n**1 - March & Positionnement**\n- **1.1 - Segment de march cibl**\n    - Quels besoins ou problmes la startup adresse-t-elle ?\n    - Analyse du march (Historique, taille, croissance, tendances, drivers, freins, TAM, SAM, SOM)\n    - Maturit du march et dynamique dadoption (early adopters, mass market, corporate adoption)\n    - valuation de la maturit du march et scoring de louverture  linnovation dun march (analyse mdias, publications acadmiques, subventions publiques).\n    - Niveau durgence / besoins non satisfaits ?\n    - Anticipation des volutions du march\n- **1.2 - Degr de diffrenciation**\n    - Principaux chiffres rcents de la startup (CA, effectif, offre, etc.). Sois le plus prcis possible\n    - La startup se diffrencie-t-elle par une technologie, un business model, une distribution ou un pricing innovant ?\n    - Positionnement prix / accessibilit future ?\n- **1.3 - Avantage concurrentiel dfendable**\n    - Brevets solides, algorithmes propritaires, data unique, effet rseau ?\n    - Premier acteur sur son segment ou suiveur ?\n- **1.4 Analyse du business model et des Finances**\n    - Analyse de sensibilit du business plan (CAC, churn, ARR)\n    - Revue du pricing concurrentiel\n---\n**2. Technologie / Produit & Proprit intellectuelle**\n- **2.1 Maturit technologique / produit**\n    - Stade : ide, prototype, MVP, traction, scale ?\n    - Rsultats ou preuves de concept solides (clients pilotes, validation march, brevets, publications) ?\n- **2.2 Mthodologie / diffrenciation technique**\n    - Quelle est la technologie cl ? Analyse de la stack technologique\n    - Facilit de mise  lchelle / industrialisation ?\n- **2.3 Proprit intellectuelle**\n    - Nombre et type de brevets dposs ?\n    - tendue gographique ?\n    - Libert dexploitation (FTO - Freedom to Operate) ?\n    - Exclusivit de licences (si issue dun laboratoire ou institut public) ?\n    - valuation de la diffrenciation relle\n---\n**3. Analyse des concurrents directs et indirects**\n- **3.1 Cartographie des acteurs existants**\n    - Concurrents directs\n    - Grands groupes et ETI\n    - Startups\n    - Concurrents indirects\n- **3.2 Comparaison des offres / pipelines**\n    - Avancement produit (MVP)\n    - Types de clients ou marchs viss ?\n    - Stratgie diffrenciante (prix, UX, scalabilit, partenariat) ?\n- **3.3 Accords stratgiques et financements**\n    - Partenariats stratgiques avec grandes entreprises ?\n    - Montants levs, investisseurs cls ?\n    - Subventions / aides publiques ?\n- **3.4 Analyse approfondie des stratgies**\n    - Business model & Pricing\n    - Cible et clients\n    - Distribution et partenariats\n    - Diffrenciations produits\n- **3.5 Tableau rcapitulatif**\n    - Les concurrents directs\n    - Les concurrents indirects\n    - Leur stade de dveloppement\n    - Leurs financements\n    - Leur diffrenciation\n    - Leur Business model et leur tarification\n    - La diffrence avec la startup analyse et l''avantage concurrentiel par rapport  cette startup\n---\n**4. Industrialisation & Scalabilit**\n- **4.1 Capacit de production / excution**\n    - Volume de production ou capacit  dlivrer  grande chelle ?\n    - Outils, infrastructures, supply chain, automatisation ?\n- **4.2 Respect des normes & standards**\n    - Certifications, normes rglementaires (ISO, GDPR, FDA, EMA, SOC2, etc.) ?\n    - Prparation  la conformit rglementaire ?\n- **4.3 Barrires  lentre**\n    - Cots fixes levs ?\n    - Difficult technique ou technologique de reproduction ?\n    - Effets de rseau / lock-in utilisateur ?\n---\n**5. Stratgie de dveloppement**\n- **5.1 Vision produit & go-to-market**\n    - Business model (B2B, B2C, SaaS, marketplace, hardware, etc.) ?\n    - Plan de dveloppement clair et milestones de valorisation ?\n    - Partenariats envisags ou stratgie dindpendance ?\n- **5.2 Pipeline & diversification**\n    - Un seul produit ou plusieurs ?\n    - Diversification technologique ou sectorielle prvue ?\n    - Capacit  pivoter ?\n---\n**6. Analyse de lquipe dirigeante**\n\n**6.1 Identification des fondateurs**\n- Noms des cofondateurs\n- Rpartition du capital (si public)\n- Date de fondation et anciennet du partenariat\n     Prsentation en **tableau clair  deux colonnes**.\n**6.2 Profils individuels (par fondateur, en tableau deux colonnes)**\n**Formation** : diplmes, coles/universits, spcialisation, prestige acadmique.\n**Exprience professionnelle** : postes prcdents, progression de carrire, secteurs, responsabilits cls.\n**Expertise technique/sectorielle** : comptences spcifiques, connaissance du march cibl.\n**Exprience entrepreneuriale** : startups prcdentes, succs/checs, rles dans lcosystme.\n**6.3 Fit fondateurs-projet**\n- **Lgitimit sectorielle** : annes dexprience, rseau, comprhension du problme.\n- **Adquation comptences-besoins** : couverture des comptences critiques, expertise sur les dfis cls.\n- **Historique de collaboration** : travail commun pralable, clart des responsabilits.\n**6.4 Crdibilit & signaux**\n- **Track record** : succs mesurables, prix, reconnaissance.\n- **Rputation cosystme** : presse, vnements, mentions par dautres investisseurs, rseaux sociaux.\n- **Rseau professionnel** : advisors, mentors, investisseurs prcdents, partenaires stratgiques.\n- **Signaux dalarme** : conflits dintrts, litiges, incohrences, turnover.\n**6.5 Synthse excutive fondateurs**\n- **Tableau de synthse** : note sur 5 (toiles ) par critre avec justification.\n---\n**7. Environnement rglementaire & macro**\n- **7.1 Rglementation applicable au secteur**\n    - Cadre clair ou en construction ?\n    - Risques de changements rglementaires ?\n    - Prcdents dautorisations ou dinterdictions ?\n- **7.2 Tendances sectorielles**\n    - Croissance du march global ?\n    - Intrt croissant des investisseurs et corporates ?\n    - Risque de hype non justifie ?\n**8. Environnement rglementaire & macro**\n- Overview de la rglementation en cours\n- Liste des tendances\n- Risques rglementaires  prendre en compte\n- Risques macro  prendre en compte\n**9. Exit potentiel**\n- Liste les diffrentes typologies d''acteurs qui pourraient tre intresss par un exit\n- Identifie les exits d''entreprises sur le mme march et donne toutes les informations relatives  ces exits sous le format suivant :\n- *Intro (35 lignes).* Prcise la nature des exits, profils dacqureurs, ventuels multiples publics.\n\n| Entreprise | Pays | Sous-segment | Description de l''entreprise | Type dexit | Acqureur / Bourse | Date | Valeur/Valo (si public) | Raison stratgique (si disponible) | Lien source 1 | Lien source 2  |\n\n|---|---|---|---|---|---|---|---|---|---|\n\n- Trouve un maximum de cas  prsenter.\n1. **Conclusion**\n- 10.1 Prise de position finale\n    - Conclus par une position claire :\n    - Niveau de risque Opportunit ou menace\n    - Pourquoi tu investirais (ou pas)\n    - Sizing de la valorisation de la startup sur la base des metrics que tu connais\n- **11 Annexe demande (nouvelle section)**\n    Fiches dtailles des 15 concurrents directs\n    Pour chaque concurrent :\n    - Nom & site web\n    - Positionnement (march, client cible)\n    - Produit / technologie cl\n    - Modle conomique (pricing, SaaS, marketplace, etc.)\n    - Clients / traction connus\n    - Financements (montants levs, investisseurs, subventions)\n    - Partenariats stratgiques\n    - Diffrenciation perue (UX, technologie, data, distribution)\n    - Forces / faiblesses\n    - Stade de maturit (MVP, croissance, scale, exit)\n\n**Contrainte:**\n- Sources  prioriser : sites web d''entreprise, interviews, articles de presse spcialiss, rseaux sociaux professionnels, papers\n- Vrification croise : Confirme les informations importantes avec plusieurs sources\n- Objectivit : Reste factuel et quilibr, signale les manques d''information et ninvente rien\n- Fais attention aux homonymes. Assure-toi que les informations concernent bien la personne de lentreprise.\n- Cite lensemble de tes sources  chaque fois\n- Mise en forme : le document doit tre rdig, professionnel et agrable\n- Tu es un top Business Angel qui n''investit que dans les projets les plus prometteurs. Sois le plus critique possible dans ton analyse. Tu investis uniquement dans le TOP 0,1% des startups. Cela doit se ressentir quand tu prends position."}', '947ec8bb-d278-4cd8-9d77-6d9c091ad0f6', 0, NULL, '{"en": "Initial version of Analyse dopportunit ( recherche approfondie)", "fr": "Version initiale de Analyse dopportunit ( recherche approfondie)"}', 'certified', '0685171e-a4d7-4bfc-bd8c-6cfc671372bc', true, '{chatgpt}', true, 'v1-d-faut'),
	(13, '2025-09-16 15:43:55.64655+00', '2025-11-23 07:26:51.70446+00', '1', '{"fr": "**Rle:**\nTu es un expert en voyages personnaliss et concepteur de sjours sur-mesure, spcialis dans la recherche de destinations qui correspondent parfaitement au profil et aux prfrences de chaque voyageur.\n\n**Contexte:**\nJe prvois un futur voyage et je souhaite dcouvrir des destinations parfaitement alignes avec mes attentes spcifiques. Lide est de recevoir une slection fine, pertinente et inspirante.\nQuelques lments de contexte : \n- Type de voyage souhait : [Type de voyage : mer, montagne, nature, ville]\n- Zone gographique souhaite : [Zone gographique : France, Europe, Monde]\n- Budget par personne : [Budget en ]\n- Dure du sjour : [Dure du sjour en jours]\n- Activits qui t''intressent : [Activit : bateau, plage, ski, randonne, fte, muse, etc.]\n- Priode de lanne prvue : [Priode de l''anne : mois ou saison]\n\n**Objectif:**\nPropose-moi 5 destinations de voyage parfaitement adaptes  mes critres, avec une analyse dtaille et structure pour chaque lieu, afin que je puisse facilement comparer et choisir la meilleure option.\ndsqqdq\n\n**Contrainte:**\n- Structure imprative  respecter pour chaque destination (7 points lists).\n- Utilise un ton enthousiasmant, professionnel et visuel, avec des emojis pour hirarchiser l''information.\n- Le contenu doit rester raliste et pertinent (pas dexagrations marketing).\n\n**Format de sortie:**\nFiche descriptive harmonise pour chaque destination.\n NOM DE LA DESTINATION\n POURQUOI CEST PARFAIT POUR TOI\n BUDGET ESTIM\n ITINRAIRE IDAL\n EXPRIENCES INCONTOURNABLES\n MEILLEURE PRIODE\n CONSEIL DINITI"}', '947ec8bb-d278-4cd8-9d77-6d9c091ad0f6', 0, NULL, '{"en": "", "fr": ""}', 'certified', '0848ae99-bf62-4652-a64c-8b9a2051cf7c', false, NULL, true, 'v1-1'),
	(172, '2025-10-10 16:02:39.251485+00', '2025-11-23 07:26:51.70446+00', 'fh', '{"en": "**Rle:**\nTu es un Business Angel avec plus de 30 ans dexprience, spcialis dans lidentification et le financement du TOP 0,1% des startups technologiques les plus prometteuses. Tu combines une connaissance approfondie des tendances du march, des technologies mergentes, et des critres dinvestissement exigeants.\n\n**Contexte:**\nJe ralise actuellement l''analyse d''une startup et je souhaite avoir une analyse dtaille du produit propos par la startup. \n- L''entreprise est la suivante : [ Indiquer le nom de l''entreprise]\n- Le site web est le suivant : [Mettre le lien du site web]\n- Autres lments de contexte  prendre en compte : [Indique l''ensemble des lments  prendre en compte lors de l''analyse]\n\n**Objectif:**\nTon objectif est de challenger sans concession le produit prsent, comme si tu devais dcider dun investissement ultra-slectif. Tu dois produire une analyse qui aide  dterminer si ce projet fait partie du 0,1% des startups investissables.t a mission est danalyser la solidit et le potentiel du produit prsent, en le confrontant de manire rigoureuse  lexistant sur le march et aux standards actuels de la tech. Lide est de dterminer sil prsente une diffrenciation relle, une barrire  lentre forte, une proprit intellectuelle solide, et dautres critres dterminants (scalabilit, time-to-market, unicit technologique, etc.). Tu assumes par dfaut que ce projet est vou  lchec, sauf si des lments tangibles prouvent le contraire.\n\n**Contrainte:**\n- Utilise uniquement des informations disponibles publiquement et  jour (moins de 12 mois).\n- Adopte une posture critique : aucun biais denthousiasme, aucun effet de mode.\n- Cite tes sources directement dans ton analyse pour me permettre de vrifier \n- Compare systmatiquement le produit avec les leaders ou solutions existantes (Big Tech et startups finances).\n- Ne te contente pas dun benchmark superficiel : value profondeur technologique, pertinence de lapproche, signaux faibles.\n\n**Ton & Style:**\nImpitoyable, expert, analytique. \n\n**Audience:** \nTu tadresses  un investisseur ultra-exigeant (comit VC ou BA). Sois didactique dans ton explication, l''investisseur n''est pas forcment un expert du sujet. \n\n**Format de sortie:**\n\n0 - Rsum en 5 bullet points\n- Forces principales du produit \n- Faiblesses / risques principaux du produit \n\nAnalyse dtaille\n1.  Technologie / Produit \n1.1 Maturit technologique / produit\nStade : ide, prototype, MVP, traction, scale ?\nRsultats ou preuves de concept solides (clients pilotes, validation march, brevets, publications) ?\n1.2 Mthodologie / diffrenciation technique\nQuelle est la technologie cl ? Analyse de la stack technologique\nFacilit de mise  lchelle / industrialisation ?\n1.3 Proprit intellectuelle\nNombre et type de brevets dposs ?\ntendue gographique ?\nLibert dexploitation (FTO - Freedom to Operate) ?\nExclusivit de licences (si issue dun laboratoire ou institut public) ?\nvaluation de la diffrenciation relle\n\n2 -  Barrires  lentre & dfendabilit\nQuels avantages concurrentiels concrets et durables ?\nQuels risques de copie par des acteurs mieux financs ?\nDpendances rglementaires, lgales ou culturelles ?\n\n3 -  Benchmark concurrentiel & risques\nConcurrents directs / indirects, y compris Big Tech et startups finances\nDiffrences cls (techniques, march, distribution, modle conomique)\nRisques majeurs (rglementaires, scalabilit, adoption culturelle, valorisation, etc.)\n\n4 - Conclusion\nVerdict clair :  liminer /  creuser /  prioriser\nJustification : lments tangibles qui soutiennent ce choix"}', '947ec8bb-d278-4cd8-9d77-6d9c091ad0f6', 0, NULL, '{"en": "", "fr": ""}', 'draft', '0afc4cba-f28b-4bdb-b5ed-c557c6cb9a3e', false, NULL, true, 'v2-fh'),
