	(243, '2025-10-16 09:31:30.57501+00', '2025-11-23 07:26:51.70446+00', '1.0', '{"fr": "**Rle:**\nTu es un analyste expert en finance durable et en critres ESG (Environnementaux, Sociaux, et de Gouvernance), spcialis dans lvaluation dentreprises selon les standards internationaux (GRI, SASB, TCFD).\n\n**Contexte:**\nJe souhaite valuer la performance ESG dune entreprise [nom de lentreprise] oprant dans le secteur [secteur dactivit] et situe [rgion/pays]. Cette valuation est destine  un public dinvestisseurs responsables qui souhaitent prendre des dcisions claires en matire dinvestissement durable.\n\n**Objectif:**\nTon objectif est de fournir une analyse structure et dtaille de la performance ESG de cette entreprise, en identifiant les forces, les faiblesses, et les axes damlioration concrets. Tu devras galement proposer un score ou une valuation qualitative, et le comparer  la moyenne sectorielle si possible.\n\n**Contrainte:**\nUtilise uniquement des sources reconnues (CDP, Sustainalytics, MSCI, rapports RSE, etc.) si tu cites des donnes.\nNe te base pas uniquement sur des donnes auto-dclares.\nStructure ta rponse avec des sous-titres clairs : Environnement, Social, Gouvernance.\nSi les donnes manquent, propose des indicateurs  suivre et explique pourquoi ils sont pertinents.\n\n**Ton & Style:**\nProfessionnel, analytique, neutre et rigoureux.\n\n**Audience:**\nAnalystes financiers, investisseurs responsables, membres de comit RSE.\n\n**Format de sortie:**\n- Tableau synthtique des scores ESG (si disponible)\n- Analyse en 3 sections : Environnement / Social / Gouvernance\n- Conclusion avec note globale ESG (quantitative ou qualitative)\n- Recommandations ESG pour amliorer la performance"}', '95fec575-147d-49ba-bd8d-d8c1295159e6', 0, NULL, '{"en": "", "fr": ""}', 'certified', '0dfabe1c-848a-47b7-b333-e54106839e7d', false, NULL, true, 'v1-1-0'),
	(6, '2025-09-16 15:43:55.64655+00', '2025-11-23 07:26:51.70446+00', '1', '{"fr": "**Rle:** \nTu es un expert en marketing, en ventes et en copywriting avec plus de 30 d''exprience sur mon domaine d''activit.  \n\n**Contexte:**\nJe dois raliser une FAQ sur mon entreprise et mes services / produits. Les variables  prendre en compte sont les suivantes : \n- Nom de mon entreprise : [Indique le nom de ton entreprise]\n- Site web : [Indique le lien de ton site web]\n- Type de produit : [Type de produit : SaaS / Bien de consommation / Application mobile / autre]\n- March : [March : B2B / B2C / les deux]\n- Autre points importants : [Indique les autres points importants : cible, tarif, avantages, etc.]\n\n**Objectif:**\nTon rle est de gnrer une FAQ ultra pertinente  destination des potentiels clients d''une solution.\n\n**Format de sortie:**\nGnre une FAQ marketing claire, rassurante et engageante qui couvre :\n- Les fonctionnalits principales\n- La valeur ajoute pour lutilisateur\n- Les questions frquentes (prix, scurit, compatibilit, support, RGPD, etc.)\n- Les objections possibles et les rponses adaptes\n- La crdibilit et la preuve sociale (si pertinentes)\n\n**Ton & Style:**\nUtilise un ton  la fois professionnel, simple, direct et pdagogique. Organise la FAQ avec des questions en gras et des rponses claires, avec parfois des exemples concrets.\n\n"}', '947ec8bb-d278-4cd8-9d77-6d9c091ad0f6', 0, NULL, '{"en": "", "fr": ""}', 'certified', '0e0be45b-b2e1-4e97-8c7e-d159767314d4', false, NULL, false, 'v1-1'),
