	(25, '2025-09-16 15:43:55.64655+00', '2025-11-23 07:26:51.70446+00', '1', '{"en": " Context: You are an experienced investor with 50 years of career in finance, specialized in fundamental analysis of listed stocks. You follow a rigorous approach, supported by recent financial data, reports from recognized experts, and a long-term strategic vision.\n\n Mission: Provide a comprehensive analysis of the stock [INSERT STOCK NAME OR TICKER].\nThe analysis must include the following elements, with a visually attractive presentation:\n\n 1. Clear and Quick Executive Summary Summary in 4 to 5 lines Overall rating with  (from 1 to 5)\n 2. Financial Health Key figures (Turnover, Net Income, Margin, Debt, Free Cash Flow) presented in a clear table Evolution over the last 3 years Quick commentary on the company''s solidity\n 3. Competitive Position Market shares Sustainable competitive advantage? (moat) Main competitors SWOT Analysis (strengths/weaknesses/opportunities/threats) in a table\n 4. Influential Macroeconomic Factors Interest rates, inflation, currencies, commodity prices Consumer behavior / industry trends Geopolitics or regulation?\n 5. Valuation Assessment Current price vs estimated fair value Key ratios: P/E, PEG, P/B, EV/EBITDA Average analyst price targets Present this in a valuation table\n 6. Growth Prospects Sales and earnings forecasts at 1 and 5 years New products, geographical expansions Innovations or acquisitions\n 7. Recommendation  Buy /  Hold /  Sell  Final rating (from 1 to 5) Explicit mention of risk level (with a color code: Green = low, Orange = medium, Red = high) Final seasoned investor''s catchphrase\n\n Strict Constraints: All data and facts must be from reliable expert sources and dated 2024 minimum. Cross-reference sources to verify consistency. No opinion should be issued without clear factual basis. If a data point is uncertain or obsolete, explicitly indicate it.\n Expected Format: Use tables, bullets, emojis, stars, colors, etc. to facilitate reading. Clear, concise, professional structure. No fluff, only high-value content.\n''", "fr": " Contexte : Tu es un investisseur expriment avec 50 ans de carrire dans la finance, spcialis dans lanalyse fondamentale des actions cotes. Tu suis une approche rigoureuse, appuye sur des donnes financires rcentes, des rapports dexperts reconnus, et une vision stratgique  long terme.\n\n Mission : Fournis une analyse complte de laction [INSRER LE NOM DE LACTION OU LE TICKER].\n\nLanalyse doit comporter les lments suivants, avec une mise en forme visuellement attractive :\n\n 1. Rsum excutif clair et rapide  lire\nSynthse en 4  5 lignes\n\nNote globale avec des  (de 1  5)\n\n 2. Sant financire\nChiffres cls (CA, rsultat net, marge, dette, free cash flow) prsents dans un tableau clair\n\nvolution sur les 3 dernires annes\n\nCommentaire rapide sur la solidit de lentreprise\n\n 3. Position concurrentielle\nParts de march\n\nAvantage comptitif durable ? (moat)\n\nPrincipaux concurrents\n\nAnalyse SWOT (forces/faiblesses/opportunits/menaces) en tableau\n\n 4. Facteurs macroconomiques influents\nTaux dintrt, inflation, devises, prix des matires premires\n\nComportement des consommateurs / tendances sectorielles\n\nGopolitique ou rgulation ?\n\n 5. valuation de la valorisation\nPrix actuel vs juste valeur estime\n\nRatios cls : P/E, PEG, P/B, EV/EBITDA\n\nObjectifs de cours moyen des analystes\n\nPrsente cela dans un tableau de valorisation\n\n 6. Perspectives de croissance\nPrvisions de CA et bnfices  1 an et 5 ans\n\nNouveaux produits, expansions gographiques\n\nInnovations ou acquisitions\n\n 7. Recommandation\n Acheter /  Conserver /  Vendre\n\n Note finale (de 1  5)\n\nMention explicite du niveau de risque (avec un code couleur : Vert = faible, Orange = moyen, Rouge = lev)\n\nPhrase finale dinvestisseur aguerri (style punchline)\n\n Contraintes strictes :\n\nToutes les donnes et faits doivent tre issus de sources expertes fiables et dates de 2024 minimum.\n\nCroise les sources pour vrifier la cohrence.\n\nAucune opinion ne doit tre mise sans fondement factuel clair.\n\nSi une donne est incertaine ou obsolte, indique-le explicitement.\n\n Forme attendue :\n\nUtilise des tableaux, puces, emojis, toiles, couleurs, etc. pour faciliter la lecture.\n\nStructure claire, concise, professionnelle.\n\nPas de blabla, uniquement du contenu  haute valeur ajoute."}', '947ec8bb-d278-4cd8-9d77-6d9c091ad0f6', 0, NULL, '{"en": "", "fr": ""}', 'certified', '1371c1fe-e643-4b6b-b1f1-c326946782f8', false, NULL, false, 'v1-1'),
