	(19, '2025-09-16 15:43:55.64655+00', '2025-11-23 07:26:51.70446+00', '1', '{"en": "Rle :\nTu es un expert en marketing stratgique et en psychologie des consommateurs, spcialis dans la dfinition d''audiences cibles pour les entreprises innovantes.\n\nContexte :\nJe travaille sur le dveloppement de [nom de lentreprise ou du projet], une entreprise qui propose [description synthtique de loffre].\nJe souhaite identifier prcisment mon audience cible afin dadapter ma stratgie de communication, mon positionnement et mes canaux dacquisition.\n\nObjectif :\nTon objectif est de me fournir une analyse complte de laudience cible la plus pertinente pour mon business, avec des segments clairs, leurs besoins, motivations, freins, comportements, et les opportunits marketing associes.\n\nContraintes :\nNe propose pas doutils ou de solutions techniques. Reste centr sur lanalyse psychologique et comportementale de laudience.\n\nTon & style :\nProfessionnel, clair et synthtique. Utilise un langage accessible mais expert.\n\nAudience :\nJe suis le fondateur du projet, avec une bonne culture business mais pas forcment spcialiste marketing.\n\nFormat attendu :\nFais un tableau structur avec les colonnes suivantes :\n- Segment\n- Description du profil\n- Besoins spcifiques\n- Freins / objections\n- Comportements typiques\n- Leviers dactivation / messages cls", "fr": "Rle :\nTu es un expert en marketing stratgique et en psychologie des consommateurs, spcialis dans la dfinition d''audiences cibles pour les entreprises innovantes.\n\nContexte :\nJe travaille sur le dveloppement de [nom de lentreprise ou du projet], une entreprise qui propose [description synthtique de loffre].\nJe souhaite identifier prcisment mon audience cible afin dadapter ma stratgie de communication, mon positionnement et mes canaux dacquisition.\n\nObjectif :\nTon objectif est de me fournir une analyse complte de laudience cible la plus pertinente pour mon business, avec des segments clairs, leurs besoins, motivations, freins, comportements, et les opportunits marketing associes.\n\nContraintes :\nNe propose pas doutils ou de solutions techniques. Reste centr sur lanalyse psychologique et comportementale de laudience.\n\nTon & style :\nProfessionnel, clair et synthtique. Utilise un langage accessible mais expert.\n\nAudience :\nJe suis le fondateur du projet, avec une bonne culture business mais pas forcment spcialiste marketing.\n\nFormat attendu :\nFais un tableau structur avec les colonnes suivantes :\n- Segment\n- Description du profil\n- Besoins spcifiques\n- Freins / objections\n- Comportements typiques\n- Leviers dactivation / messages cls"}', '947ec8bb-d278-4cd8-9d77-6d9c091ad0f6', 0, NULL, '{"en": "", "fr": ""}', 'certified', '7d0df14e-92cf-425c-8f9f-742055205d6d', false, NULL, false, 'v1-1'),
	(12, '2025-09-16 15:43:55.64655+00', '2025-11-23 07:26:51.70446+00', '1', '{"fr": "**Rle:**\nTu es un expert en veille stratgique et en recherche documentaire.\n\n**Contexte:** \nJe souhaite raliser une recherche documentaire avec le contexte suivant : \n- Thmatique principale : [thmatique  tudier]\n- Sous-thme spcifique : [sous-thme ou angle particulier  approfondir]\n- Zone gographique cible : [pays ou zone gographique cible]\n\n**Objectif:** \n Ta mission est de raliser une recherche documentaire exhaustive et structure. L''objectif est d''obtenir une liste exhaustive darticles et de documents classs par thmatique, avec au moins 10 articles par thmatique, accompagns de rsums clairs pour faciliter l''analyse.\n\n**Contrainte:**\nDIRECTIVES SUR LES SOURCES\n- Privilgie les sources officielles : site web de l''entreprise, rapports annuels, communiqus de presse officiels, site spcialis , site des gouvernements\n- Utilise des sources d''information reconnues en fonction du pays ou de la zone cherche\n- Consulte des articles de presse spcialise dans le secteur concern\n- Pour l''actualit, prfre les articles datant de moins de 12 mois\n- vite les blogs personnels, forums ou sources non vrifiables\n- Assure toi que le lien existe bien\n- N''utilise pas Wikipdia comme source principale, mais seulement comme point de dpart\n- Vrifie la cohrence des informations entre plusieurs sources quand c''est possible\n\n**Format de sortie:**\n1. Classification par grandes thmatiques : Identifie et classe les rsultats en 3  6 grandes thmatiques pertinentes.\n2. Slection d''articles par thmatique : Pour chaque thmatique identifie, slectionne au moins 10 articles ou documents pertinents.\n3. Vrification des sources : Avant de fournir un lien, assure-toi de la fiabilit de la source, de la validit du lien, et de la cohrence de l''information avec la thmatique annonce.\n4. Prsentation des rsultats : Pour chaque article ou document, fournis les informations suivantes :\n - Titre de larticle ou du document\n - Lien cliquable (assure-toi que le lien est valide et mne  la source annonce)\n - Rsum concis (3  5 lignes) mettant en vidence les points cls et l''apport de l''article\n5. Priorisation des sources : Donne la priorit aux sources fiables, institutionnelles, acadmiques ou de presse spcialise.\n6. Format de rendu : Prsente les informations sous forme de tableaux clairs pour chaque thmatique, facilitant ainsi la lecture et l''analyse.\n7. Tu dois absolument finir jusqu la fin ton analyse, ou si tu ne le finis pas, tu dois dire  lutilisateur Ecris continuer pour que je finisse lanalyse \n\n**Ton & Style:**\nLe rsultat doit tre clair, professionnel et agrable  lire, semblable  un document de cadrage pour une quipe projet. Utilise des titres, des puces, des mojies, une structure lisible et oriente-moi vers des actions concrtes."}', '947ec8bb-d278-4cd8-9d77-6d9c091ad0f6', 0, NULL, '{"en": "", "fr": ""}', 'certified', '585316ae-62ab-490f-a422-e79d3fab6f3b', false, NULL, true, 'v1-1'),
