	(135, '2025-10-06 09:38:59.24599+00', '2025-11-23 07:26:51.70446+00', '1.0', '{"fr": "**Rle :**\nTu es un analyste expriment avec une trs forte expertise sur le march suivant : **[Indiquer le march  benchmarker]**, et notamment une trs bonne connaissance de l''ensemble des acteurs de ce march, en France, en Europe et  linternational.\n\n**Contexte :**\nJe suis un Business Angel expriment et je ralise une tude d''opportunit sur la startup suivante : **[Nom de la startup]**, dont le site web est le suivant : **[Indiquer l''URL du site web]**. Je souhaite me renseigner sur la concurrence existante pour valuer les forces en prsence sur le march cibl par cette startup.\n\n**Objectif :**\nTon objectif est de lister l''ensemble des concurrents directs et indirects de cette startup, avec les principales informations utiles pour analyser leur positionnement. Tu dois me fournir les liens cliquables vers les sites web officiels des concurrents pour me permettre de les consulter rapidement.\n\n**Format de sortie :**\n1. Introduction avec une analyse du dynamisme du march\n2. Tableaux des acteurs\n    Je souhaite que les rsultats soient organiss dans 3 tableaux distincts :\n- 2)a) Concurrents France\n- 2)b) Concurrents Europe\n- 2)c) Concurrents Monde\nPour chaque concurrent list, fournis les informations suivantes dans chaque tableau :\n- Nom de lentreprise\n- Chiffre daffaires (CA)\n- Taille (effectifs)\n- Montant des leves de fonds (totales ou rcentes)\n- Pays dorigine\n- Principaux clients ou segments cibles\n- Date de cration\n- Positionnement stratgique ou USP\n- Lien cliquable vers le site web officiel\n3. Conclusion\n\n**Contrainte :**\n- Utilise uniquement des sources reconnues : sites web des entreprises, bases de donnes professionnelles, mdias spcialiss (Sifted, Crunchbase, Dealroom, etc.), cabinets danalyse de march.\n- Nutilise que des informations dates de moins de 12 mois, sauf si une information plus ancienne est cruciale pour comprendre le positionnement.\n- Recoupe les sources quand cela est ncessaire. Si plusieurs chiffres sont disponibles, mentionne-les tous et cite les sources.\n- Chaque information importante doit tre accompagne dune citation source (lien cliquable pour vrification)."}', '947ec8bb-d278-4cd8-9d77-6d9c091ad0f6', 0, NULL, '{"en": "Initial version of Identification des concurrents", "fr": "Version initiale de Identification des concurrents"}', 'certified', '59973450-0554-405f-8cbd-d19657713faf', true, '{chatgpt}', true, 'v1-1-0'),
