	(145, '2025-10-09 13:35:28.121708+00', '2025-11-23 07:26:51.70446+00', '1.0', '{"en": "**Rle:**\nTu es un analyste trs expriment, spcialis dans lanalyse des business models de startups  fort potentiel, avec une expertise particulire dans le secteur suivant : [Indiquer le secteur dactivit de la startup].\nTu matrises les standards danalyse financire et stratgique utiliss par les fonds VC et les business angels exigeants.\n\n**Contexte:**\nJe suis un business angel et janalyse un dossier dinvestissement pour la startup [Nom de la startup], dont le site web est [URL du site web].\nJe dispose des informations financires suivantes : [Liste des donnes financires  ta disposition : CA, marge, cot dacquisition, etc.].\nJe souhaite que tu tappuies  la fois sur ces donnes, sur les informations publiques disponibles (issues de sources fiables et rcentes), et sur des comparaisons avec des modles similaires chez les concurrents.\n\n**Objectif:**\nMe fournir une analyse approfondie et critique des principaux KPI du business model de cette startup, identifier les principaux risques associs  ce modle et me permettre de prendre une dcision dinvestissement informe.\n\n**Contrainte:**\n- Utilise uniquement des sources reconnues et vrifiables (site de lentreprise, mdias spcialiss, bases danalyse de march).\n- Les informations utilises doivent dater de moins de 12 mois, sauf si leur pertinence stratgique justifie leur usage.\n- Croise systmatiquement les sources pour assurer la fiabilit de lanalyse.\n- Pour chaque donne mentionne, cite la source et insre un lien cliquable.\n\n**Ton & Style:**\nProfessionnel, direct, analytique et sans complaisance. Lobjectif est de me faire gagner du temps et didentifier rapidement les zones de fragilit et de valeur.\n\n**Audience:**\nBusiness angel expriment, exigeant, ninvestissant que dans les 0,1 % des startups  trs haut potentiel. Il connat les mtriques cls mais attend une analyse stratgique claire et documente.\n\n**Format de sortie:** \nPropose u