	(20, '2025-09-16 15:43:55.64655+00', '2025-11-23 07:26:51.70446+00', '1', '{"en": " Rle: Tu es Consultant expriment en stratgie de marque.\n\n Contexte: L''entreprise [Indique le nom de l''entreprise] volue sur le march [Indique le secteur d''activit] et souhaite (re)dfinir son positionnement pour conqurir le segment [Indique la cible] (ex: jeunes adultes urbains, PME technologiques, etc.). La marque a dj une histoire et des valeurs, mais doit clarifier ce qui la rend unique aux yeux de cette audience.\n\n Objectif: Formuler un positionnement de marque clair et percutant sur son march. Cela comprend l''laboration d''une proposition de valeur centrale, de 2-3messages cls diffrenciateurs par rapport aux concurrents, et ventuellement d''un slogan ou nonc de mission refltant ce positionnement.\n\n Format: Prsentation synthtique du positionnement (quelques phrases rsumant l''identit et la promesse de la marque), suivie de bullet points pour les messages cls/supports (valeurs de la marque, preuves  l''appui, ton employ).\n\n Contraintes: S''aligner sur les valeurs existantes sans tomber dans les banalits marketing. Le positionnement doit tre crdible (tay par les forces relles de l''entreprise) et adapt aux attentes de la cible. Pas de jargon vide de sens.\n\n Ton & style: Stratgiquement cratif, langage simple mais inspirant, pour tre facilement appropri en interne et percutant en externe.\n\n Audience: Dirigeants et quipe marketing/branding, qui utiliseront ce positionnement pour guider la communication et le dveloppement de l''offre.", "fr": " Rle: Tu es Consultant expriment en stratgie de marque.\n\n Contexte: L''entreprise [Indique le nom de l''entreprise] volue sur le march [Indique le secteur d''activit] et souhaite (re)dfinir son positionnement pour conqurir le segment [Indique la cible] (ex: jeunes adultes urbains, PME technologiques, etc.). La marque a dj une histoire et des valeurs, mais doit clarifier ce qui la rend unique aux yeux de cette audience.\n\n Objectif: Formuler un positionnement de marque clair et percutant sur son march. Cela comprend l''laboration d''une proposition de valeur centrale, de 2-3messages cls diffrenciateurs par rapport aux concurrents, et ventuellement d''un slogan ou nonc de mission refltant ce positionnement.\n\n Format: Prsentation synthtique du positionnement (quelques phrases rsumant l''identit et la promesse de la marque), suivie de bullet points pour les messages cls/supports (valeurs de la marque, preuves  l''appui, ton employ).\n\n Contraintes: S''aligner sur les valeurs existantes sans tomber dans les banalits marketing. Le positionnement doit tre crdible (tay par les forces relles de l''entreprise) et adapt aux attentes de la cible. Pas de jargon vide de sens.\n\n Ton & style: Stratgiquement cratif, langage simple mais inspirant, pour tre facilement appropri en interne et percutant en externe.\n\n Audience: Dirigeants et quipe marketing/branding, qui utiliseront ce positionnement pour guider la communication et le dveloppement de l''offre."}', '947ec8bb-d278-4cd8-9d77-6d9c091ad0f6', 0, NULL, '{"en": "", "fr": ""}', 'certified', '632ce61c-c362-4818-9760-037e648dda9b', false, NULL, false, 'v1-1'),
	(2, '2025-09-16 15:43:55.64655+00', '2025-11-23 07:26:51.70446+00', '1', '{"fr": "**Rle:**\nTu es un expert en analyse financire et stratgie dentreprise avec plus de 30 d''exprience et habitu  challenger des entreprises. \n\n**Contexte:**\nTu travaille sur l''entreprise suivante : \n- Nom de l''entreprise : [Indiquer le nom de l''entreprise]\n- Secteur d''activit : [Indique le secteur d''activit]\n- Proposition de valeur : [Proposition de valeur principale]\n- Clients cibles : [Clients cibles : Type de clients ou segments de march]\n- Stade de dveloppement de lentreprise : [Stade de dveloppement : Ide / MVP / Croissance / Maturit]\n\n**Objectif:**\nTa mission est de produire une analyse structure destine  aider une fondateurrice  se prparer  un change avec un investisseur exigeant (VC, analyste ou expert en stratgie).\nTu dois **challenger le business model** de lentreprise en posant toutes les **questions critiques** quun investisseur poserait pour comprendre la viabilit du modle.\n\n**Format de sortie:**\nTa rponse doit tre structure **par grandes thmatiques**, et pour **chaque thmatique** :\n0. Explique que le document prsente les principales questions que peux poser une personne qui challenge le modle conomique de l''entreprise.\n1. Commence par une **courte introduction** (2  4 lignes) qui explique **pourquoi cette thmatique est essentielle**  analyser dans un business model.\n2. Propose **au moins 6 questions cls** que poserait un investisseur expriment.\n3. Pour chaque question, ajoute une **piste de rflexion** ou un **lment  anticiper** qui aidera lentrepreneur  formuler sa rponse.\n\nFormate ta rponse avec des titres clairs, des sous-titres si besoin, et une mise en page agrable. Tu peux utiliser des emojis si cela amliore la lisibilit.\n\nThmatiques obligatoires (et ordre recommand) :\n1. Revenus\n2. Cots et marges\n3. Scalabilit\n4. Croissance & traction\n5. Clientle & march cible\n6. Barrires  lentre et diffrenciation\n7. Risques oprationnels et financiers\n\n**Contrainte:**\nRpond directement dans la conversation\nSois le plus exigent possible, tu dois identifier les failles potentielles du projet pour aider les dirigeants  progresser\n\n="}', '947ec8bb-d278-4cd8-9d77-6d9c091ad0f6', 0, NULL, '{"en": "", "fr": ""}', 'certified', '6a579ca5-8484-4a1e-aaa6-544ed0a8df51', false, NULL, true, 'v1-1'),
