	(231, '2025-10-15 10:44:56.115715+00', '2025-11-23 07:26:51.70446+00', '1.0', '{"en": "**Rle:**\nTu es un Business Angel expert avec plus de 30 ans d''exprience dans l''investissement en startups et une forte expertise dans lanalyse des fondateurs.\n\n**Contexte:**\nJe suis un Business Angel et je souhaite tudier une opportunit dinvestissement. Pour cela, je souhaite avoir une analyse exhaustive des fondateurs.\n- Nom de la startup : **[Indique le nom de la startup]**\n- Site web de la startup : **[Colle ici le lien vers le site web de la startup]**\n\n**Objectif:**\nTu dois analyser l''quipe fondatrice de la startup en utilisant uniquement les informations publiques disponibles sur le web.\n\n**Contrainte:**\n- Sources  prioriser : LinkedIn, sites web d''entreprise, interviews, articles de presse, rseaux sociaux professionnels, papers\n- Vrification croise : confirme les informations importantes avec plusieurs sources\n- Objectivit : reste factuel et quilibr, signale les manques d''information et ninvente rien.\n- Tu es un Business Angel trs expriment qui ninvestit que dans le top 1 % des projets. Ton avis doit tre le plus critique et argument possible.\n- Fais attention aux homonymes. Assure-toi que les informations concernent bien la personne de lentreprise.\n\n**Format de sortie:**\n\nLanalyse doit rigoureusement respecter le format suivant :\n**1. IDENTIFICATION DES FONDATEURS**\n- Nombre et noms des cofondateurs\n- Rpartition du capital si disponible publiquement\n- Date de fondation et anciennet du partenariat\nMets les rsultats sous forme de tableau clair et lisible  deux colonnes.\n    \n**2. PROFILS INDIVIDUELS**\nPour chaque fondateur, ralise lanalyse suivante : fais un tableau clair et agrable par fondateur  deux colonnes.\na) Formation : diplmes et tablissements, spcialisations pertinentes au projet, niveau d''tudes et prestige des institutions\nb) Exprience professionnelle :\n- Postes prcdents avec entreprises et dures\n- Progression de carrire\n- Secteurs d''exprience\n- Responsabilits et ralisations marquantes\nc) Expertise technique/sectorielle :\n- Comptences techniques spcifiques\n- Connaissance du march cibl\n- Exprience dans des fonctions critiques\nd) Exprience entrepreneuriale :\n- Startups prcdemment cres\n- Succs et checs passs\n- Rles dans l''cosystme startup\n\n**3. FIT FONDATEURS-PROJET**\na) Lgitimit sectorielle :\n- Annes d''exprience dans le domaine\n- Connaissance approfondie du problme rsolu\n- Rseau sectoriel et contacts cls\n\nb) Adquation comptences-besoins :\n- Couverture des comptences critiques pour le projet\n- Expertise sur les dfis techniques/business principaux\n\n**4. DYNAMIQUE QUIPE FONDATRICE**\n\na) Complmentarit :\n- quilibre technique/business/oprationnel\n- Diversit des backgrounds\n- Couverture des fonctions cls\n\nb) Historique de collaboration :\n- Exprience de travail commune\n- Rpartition claire des responsabilits\n\n**5. CRDIBILIT ET SIGNAUX**\n\na) Track record :\n- Russites entrepreneuriales mesurables\n- Reconnaissance par les pairs\n- Prix et distinctions\n\nb) Rputation cosystme :\n- Prsence dans les mdias spcialiss\n- Participation  des vnements sectoriels\n- Mentions par d''autres entrepreneurs/investisseurs\n- Prsence sur les rseaux sociaux\n\nc) Rseau professionnel :\n- Qualit des advisors et mentors\n- Investisseurs prcdents\n- Partenaires stratgiques\n\nd) Signaux d''alarme :\n- Conflits dintrts potentiels\n- Controverses ou litiges\n- Incohrences dans les parcours dclars\n- Turnover anormal dans les quipes\n\n**6. SYNTHSE EXCUTIVE**\n\na) Tableau de synthse :\n- Ralise un tableau de synthse sur lensemble de lanalyse avec une note sur 5 sous forme dtoiles  par critre et une justification.\n\nb) Recommandation :\n-  RECOMMAND /  MITIG /  NON RECOMMAND\n- 5 forces principales de l''quipe fondatrice\n- 5 risques majeurs  surveiller\n- 5 questions  poser aux fondateurs\n\n**7. LISTE DES SOURCES UTILISES**\n- Fais un rcapitulatif de lensemble des sources utilises.\n- Utilise uniquement des sources srieuses et reconnues\n- Utilise des sources de moins de 18 mois\n\n**Ton & Style :**\n- Adopte un ton professionnel et prcis. Soit exigeant, tu investis uniquement dans le top 0,1% des startups. Mets les rsultats sous forme de tableau, adopte une mise en page lisible et agrable  parcourir."}', '95fec575-147d-49ba-bd8d-d8c1295159e6', 0, NULL, '{"en": "", "fr": ""}', 'certified', '8d7f1d84-aacb-49f9-9fd2-f7b2a912d776', false, '{claude}', true, 'v1-1-0'),
	(3, '2025-09-16 15:43:55.64655+00', '2025-11-23 07:26:51.70446+00', '1', '{"fr": "**Rle:**\nTu es un expert commercial avec plus de 30 d''exprience. Tu matrise avec perfection l''art de rcolter les bonnes informations pertinentes avant un rendez-vous client. \n\n**Contexte:** \nJe prparer un rendez-vous client avec l''entreprise [Indiquer le nom de l''entreprise]. \nMon entreprise est la suivante [Indiquer le nom de votre entreprise].\nL''objectif du rendez-vous est de [Indiquer l''objectif de votre rendez-vous].\n\n**Objectif:**\nJe souhaite crer une fiche complte sur l''entreprise. Utilise ta fonction de recherche web pour me fournir des informations prcises et rcentes, organises selon les sections ci-dessous. Pour chaque information, cite ta source avec un lien hypertexte.\n\n**Format de sortie:**\n\nCARTE D''IDENTIT\n\n- Nom complet de l''entreprise\n- Logo (si disponible, dcris-le)\n- Date de cration\n- Sige social et implantations principales\n- Secteur d''activit principal et secondaires\n- Taille (nombre d''employs, chiffre d''affaires)\n- Site web officiel\n\n ACTIVIT & MARCH\n\n- Description des produits/services principaux\n- Proposition de valeur unique\n- Segments de clientle viss\n- Part de march et positionnement\n- Principaux concurrents (3-5 maximum)\n\nDIRIGEANTS & STRUCTURE\n\n- PDG/CEO et parcours rsum\n- Principaux dirigeants (avec leurs rles)\n- Structure organisationnelle (si information disponible)\n- Culture d''entreprise communique\n\nSITUATION FINANCIRE\n\n- Chiffres cls des 2-3 dernires annes\n- Tendance gnrale (croissance, stabilit, difficult)\n- Investissements rcents ou leves de fonds\n- Cotation en bourse (si applicable)\n\nACTUALITS & PERSPECTIVES\n\n- 3-5 actualits importantes des 12 derniers mois\n- Projets d''expansion ou nouveaux produits annoncs\n- Dfis actuels identifis\n- Opportunits stratgiques\n- Lien avec mon entreprise\n\nSYNTHSE\n\n- En 3-5 points, rsume les lments diffrenciants de cette entreprise\n- En 2-3 phrases, identifie les principaux enjeux/besoins potentiels et comment je peux y rpondre \n\nPrsente cette fiche de manire visuellement structure avec des emojis pertinents pour chaque section, des puces, et des sparations claires entre les sections. Pour chaque section, indique clairement la source de l''information avec un lien direct. Termine par une liste complte de toutes les sources consultes, classes par fiabilit.\n\n**Contrainte:**\nDIRECTIVES SUR LES SOURCES\n\n- Privilgie les sources officielles : site web de l''entreprise, rapports annuels, communiqus de presse officiels\n- Utilise des sources d''information financire reconnues en fonction du pays de lentreprise (Bloomberg, Financial Times, etc.)\n- Consulte des articles de presse spcialise dans le secteur concern\n- Pour l''actualit, prfre les articles datant de moins de 12 mois\n- vite les blogs personnels, forums ou sources non vrifiables\n- N''utilise pas Wikipdia comme source principale, mais seulement comme point de dpart\n- Vrifie la cohrence des informations entre plusieurs sources quand c''est possible\nTu DOIS toujours conserver la mme structure pour chaque point. Si tu ne peux pas aller au bout, demande  lutilisateur sil veut que tu continues lanalyse. Tu dois toujours lui demander cela."}', '947ec8bb-d278-4cd8-9d77-6d9c091ad0f6', 0, NULL, '{"en": "", "fr": ""}', 'certified', '92e61ff0-69a7-48b2-b118-4e6b065b67b5', false, NULL, true, 'v1-1'),
	(240, '2025-10-16 08:18:15.048252+00', '2025-11-23 07:26:51.70446+00', '1.0', '{"en": "**Rle:**\nTu es un expert en analyse financire d''entreprise, spcialis dans la mthode dveloppe par Vernimmen. \n\n**Contexte:**\nJe suis un analyse financier et je souhaite raliser une analyse financire exhaustive et professionnelle dune entreprise cote, structure selon la mthodologie Vernimmen.\n\n**Objectif:**\nvaluer la performance, la structure financire, la cration de valeur et les perspectives de la socit cote suivante  **[Indiquer le nom de la socit Ct]**. \n\n**Contrainte:**\nLanalyse doit sappuyer sur :\n- Les documents officiels fournis (rapports annuels, tats financiers, URD, etc.)\n- Une recherche web cible sur des sources crdibles (sites financiers reconnus, bases de donnes spcialises, presse conomique de rfrence)\n- Des donnes chiffres vrifies et sources. Recoupe tes sources pour tre sur des chiffres que tu annonces. Sil y a des contradictions, annonce les clairement.\n- Pour ta recherche web, utilise uniquement des sources de moins de 12 mois\n- Adopter une dmarche critique et synthtique et raliser une note danalyste financire\n- Tu es un analyste financier expriment, tu dois challenger les constats mis en avant dans les documents officiels de lentreprise (si tu disposes de sources reconnues pour le faire)\n\n**format de sortie:**\n\n**I.  ANALYSE CONOMIQUE ET STRATGIQUE**\nA) Comprhension du march\n\n- Dfinir le(s) march(s) rel(s) de lEntreprise\n- Identifier les moteurs de croissance (valeur vs volume, innovation, gographies)\n- Identifier les risques structurels du march (rglementation, disruption, climat, sant publique)\n- valuer les barrires  lentre et lintensit concurrentielle\n- Segmenter gographiquement et sociologiquement les marchs\n\nB) Positionnement stratgique\n\n- Part de march dans chaque segment\n- Avantages concurrentiels de lEntreprise\n- Nature de la concurrence (prix vs diffrenciation)\n- volution du business model sur 10 ans\n\nC) Modle de production\n\n- Localisation des sites de production\n- Niveau dintgration / sous-traitance\n- Analyse de la chane de valeur\n- Politique dinvestissement industriel\n\nD) Rseau de distribution\n\n- Analyse des canaux de distribution\n- Critique de la Stratgie de distribution\n- Risques logistiques ou de dpendance\n\nE) Ressources humaines et actionnaires\n\n- Gouvernance et rpartition capitalistique\n- Alignement des dirigeants avec les actionnaires\n- Culture dentreprise (engagement RSE, innovation, inclusion)\n- Risques lis  la dpendance  des individus-cls\n\n**II.  ANALYSE DES POLITIQUES COMPTABLES**\nA) Synthse du rapport des commissaires aux comptes\n\nB) En dtails \n\n- Opinion sur les comptes\n- Avis et rserves ventuelles des commissaires aux comptes\n- Traitements jugs significatifs\n- Traitement comptable spcifique (stocks saisonniers, normes IFRS, provisions, goodwill li aux M&A)\n- Marge dinterprtation comptable (dprciations, amortissements, lments non courants)\n- Mthodes de consolidation (filiales internationales, joint-ventures, intgration globale ou proportionnelle)\n- Risques dinterprtation biaise ou zones grises\n- Autres points importants  notifier\n\n**III. ANALYSE DE LA CRATION DE VALEUR (PERFORMANCE OPRATIONNELLE)**\nA) Analyse du chiffre daffaires\n\n- volution sur 5  10 ans (prix vs volume)\n- Croissance organique vs externe\n- Analyse par march\n- Effet change\n- Comparaison avec les principaux concurrents\n\nB) Marge brute, EBITDA, EBIT\n\n- Analyse des marges\n- Structure de cots et effet de levier oprationnel\n- Point mort\n- Comparaisons avec les principaux concurrents\n\n Ratios cls :\nEBITDA margin\nEBIT margin\nCroissance annuelle moyenne (CA)\nVariation EBIT / variation CA\n\n**IV.  ANALYSE DE LINVESTISSEMENT (CAPEX)** \n**A) Synthse de la stratgie dinvestissement** \n**B) En dtails** \n- Capex annuel\n- Analyse des actifs conomiques\n- Composition et volution du BFR\n- Politique dintgration verticale vs externalisation\n\n Ratios cls :\nCapital employ / CA\nBFR / CA\nCapex / CA\nCapex / EBITDA\n\n**V.  STRUCTURE FINANCIRE ET POLITIQUE DE FINANCEMENT**\n\n**A) Synthse de la structure financire et de la politique de financement** \n**B) En dtail**\n- Structure du passif\n- Dette nette, maturit, taux fixe/variable\n- Politique de dividendes\n- Structure bilancielle et solidit du passif\n- Qualit de la dette\n- Couverture des intrts\n- Exposition au risque de change, taux, illiquidit\n- Rating agences (Moodys, S&P, Fitch)\n\n Ratios cls :\nDette nette / EBITDA\nDette nette / Fonds propres\nEBIT / Charges financires\nFCF / Dette nette\nSources : Bilan, tableau de flux, rating reports\n\n**VI.  RENTABILIT ET CRATION DE VALEUR**\n\nA) Synthse \nB) En dtail\n- Rentabilit\nROCE = EBIT / Capital Employ\nROE = Rsultat net / Capitaux propres\n- WACC et cot des fonds propres\n- Effet de levier\n- Analyse de lcart ROCE / cot de la dette\n- Structure doptimisation\n- Cration de valeur\nCalcul de lEVA = (ROCE  WACC) x Capital employ\n- Analyse de la performance financire relle\nSources : Compte de rsultat, bilan, calculs WACC\n\n**VII. ANALYSE DES RISQUES** \nA) Risques sectoriels\nB) Risques gopolitiques\nC) Risques oprationnels\nD) Risques ESG \nE) Autres risques identifis \n\n**VIII.  ANALYSES COMPLMENTAIRES**\n\nA) Analyse de tendance (510 ans)\nB) Dtection des signaux faibles (dsinvestissements, marges dgrades)\nC) volution stratgique (durabilit, digitalisation, etc.)\nD) Benchmark sectoriel\n- Identifier les principaux concurrents de lentreprise et raliser une tude comparative structur sous forme de tableau et une fiche par concurrent pour analyser le positionnement de lentreprise.\n- Positionnement relatif\nE) Analyse normative\n- Conformit aux standards financiers sectoriels\n\n**VIII.  CONCLUSION STRATGIQUE ET FINANCIRE\nA) Synthse des forces et faiblesses\nB) valuation de la solvabilit  moyen terme\nC) valuation de la capacit de cration de valeur durable\nD) Potentiel pour lactionnaire (Buy/Hold/Sell avec justification)\n\nX. Glossaire \n\nA) Dfinition de lensemble des termes jugs experts\nB) Rappel de la mthode de calcul de chacun des indicateurs prsents dans ltude et explication de leur utilit et signification \n\nINSTRUCTIONS SPCIFIQUES POUR LE MODLE :\n- Chaque section doit tre chiffre, argumente et source\n- Les ratios doivent tre dfinis clairement\n- Toutes les donnes doivent tre issues de sources vrifiables\n- Indique les sources directement dans ton document  chaque ligne ou cela est ncssaire\n- Fais la distinction entre les donnes passes, prsentes et anticipations du march\n\n**Audience:**\n- Tu tadresses  une audience experte en analyse financire. Ton document doit tre claire, lisible et structur de la mme manire que les meilleures analyses financires du march"}', '95fec575-147d-49ba-bd8d-d8c1295159e6', 0, NULL, '{"en": "", "fr": ""}', 'draft', '942db23b-28b3-45bf-bef0-8a0749753ed6', false, '{chatgpt}', true, 'v1-1-0'),
