	(24, '2025-09-16 15:43:55.64655+00', '2025-11-23 07:26:51.70446+00', '1', '{"en": "Analyzing Market Trends \n\nAs an investor with 50 years of experience, provide a comprehensive analysis of current market trends in the [specify industry sector] across the [Country or world: Indicate the geographical scope of the study]. Your analysis should:\n1. Identify the main growth areas,\n2. Highlight potential risks,\n3. Identify emerging opportunities,\n4. Build on current and forecasted market conditions.\n5. Recommend 5 specific investment opportunities and specify why. \n\nYou must cite specific companies or projects You must leverage your extensive investment experience to offer concrete perspectives and relevant strategic recommendations for future investment. \n\n The analysis must be presented in the form of a clear and concise report, accessible to both industry experts and non-specialists. \n\n Important: \nUse only sources from recognized expert sites in the chosen industry, economics, or investment domains \nSources must be recent (minimum 2024) \nEach fact or data mentioned must have been verified through cross-coherence control with multiple reliable sources. \nDraw no conclusions without solid factual basis. \nPersonal opinions must always be justified by concrete data. \n\nUse emojis if necessary to streamline the report", "fr": "Analyser les tendances du march\nEn tant qu''investisseur disposant de 50 ans d''exprience, fournissez une analyse complte des tendances actuelles du march dans le secteur [indiquer le secteur d''activit] sur le primtre [Pays ou monde : Indiquez le primtre gographique de l''tude]. Votre analyse devra :\n\n1) Identifier les principaux domaines de croissance,\n\n2) Mettre en vidence les risques potentiels,\n\n3) Reprer les opportunits mergentes,\n\n4) S''appuyer sur les conditions de march actuelles et prvisionnelles.\n\n5) Recommander 5 opportunits d''investissements spcifiques et prciser pourquoi. Tu dois citer des entreprises ou des projets spcifiques\n\nVous devez mobiliser votre exprience approfondie en investissement pour offrir des perspectives concrtes et des recommandations stratgiques pertinentes en matire dinvestissement futur.\n\n Lanalyse doit tre prsente sous la forme dun rapport clair et concis, accessible aussi bien aux experts du secteur quaux non-initis.\n\n Important :\n\nUtilisez uniquement des sources provenant de sites d''experts reconnus dans les domaines de l''industriec choisie, de lconomie ou de linvestissement \n\nLes sources doivent tre rcentes (minimum 2024) \n\nChaque fait ou donne mentionn doit avoir t vrifi  travers un contrle de cohrence crois avec plusieurs sources fiables.\n\nNe tirez aucune conclusion sans fondement factuel solide. Les opinions personnelles doivent toujours tre justifies par des donnes concrtes.\n\nUtilise des mojies si ncessaire pour fluidifier le rapport"}', '947ec8bb-d278-4cd8-9d77-6d9c091ad0f6', 0, NULL, '{"en": "", "fr": ""}', 'certified', '9cd57bf9-a161-4ef4-a97b-e2d83442dcb2', false, NULL, false, 'v1-1'),
	(22, '2025-09-16 15:43:55.64655+00', '2025-11-23 07:26:51.70446+00', '1', '{"en": "You are a marketing researcher specialized in defining user personas.\n\nYour mission is to generate 3 detailed user personas for a business of [Describe your business and your value proposition].\n\nStructure your response in 4 separate steps.\n\nBefore the first table, write: USER PERSONAS\n\nUse exactly the following format:\n\nTable 01: DEMOGRAPHICS\n4 columns and 7 rows\n Column 1 = Data Points (Name, Age, Occupation, Annual Income, Marital Status, Family Situation, Location)\n Column 2 = Answers for Persona 1\n Column 3 = Answers for Persona 2\n Column 4 = Answers for Persona 3\n\nThree USER DESCRIPTIONS\nWrite a different User Description for each persona, minimum 400 characters each. Also add why this persona is relevant regarding the product. Present them like this:\n User Description 1: text\n User Description 2: text\n User Description 3: text\n\nTable 02: PSYCHOGRAPHICS\n4 columns and 9 rows\n Column 1 = Data Points (Personal Characteristics, Hobbies, Interests, Personal Aspirations, Professional Goals, Pains, Main Challenges, Needs, Dreams)\n Column 2 = Answers for Persona 1\n Column 3 = Answers for Persona 2\n Column 4 = Answers for Persona 3\n\nTable 03: PURCHASE BEHAVIORS\n4 columns and 8 rows\n Column 1 = Data Points (Budget, Purchase Frequency, Preferred Channels, Online Behavior, Search Terms, Favorite Brands, Triggers, Barriers)\n Column 2 = Answers for Persona 1\n Column 3 = Answers for Persona 2\n Column 4 = Answers for Persona 3\n\nEnd with a conclusion including:\n A summary of each personas needs and advice on how to reach each persona.", "fr": "Tu es un chercheur marketing qui est spcialis dans la dfinition de personas utilisateur. \nTa mission est de gnrer 3 personas utilisateurs dtaills pour un business de [Dcrire votre business et votre proposition de valeur] \n\nStructure ta rponse en 4 tapes spares. \n\nAvant le premier tableau, cris : USER PERSONAS\nUtilise exactement le format suivant : \n\nTableau 01 : DMOGRAPHIE 4 colonnes et 7 lignes \nColonne 1 = Points de donnes (Nom, ge, Profession, Revenu annuel, Situation matrimoniale, Situation familiale, Localisation) \nColonne 2 = Rponses pour Persona 1 \nColonne 3 = Rponses pour Persona 2 \nColonne 4 = Rponses pour Persona 3 \n\nTrois USER DESCRIPTIONS \ncris une User Description diffrente pour chaque persona, Minimum 400 caractres chacune. Rajoute galement pourquoi ce personna est pertinent au regard du produit. Prsente-les comme a : User Description 1 : texte \nUser Description 2 : texte \nUser Description 3 : texte \n\nTableau 02 : PSYCHOGRAPHIE \n4 colonnes et 9 lignes \nColonne 1 = Points de donnes (Caractristiques personnelles, Loisirs, Centres dintrt, Aspirations personnelles, Objectifs professionnels, Douleurs, Principaux dfis, Besoins, Rves) \nColonne 2 = Rponses pour Persona 1 \nColonne 3 = Rponses pour Persona 2 \nColonne 4 = Rponses pour Persona 3 \n\nTableau 03 : COMPORTEMENTS D''ACHAT \n4 colonnes et 8 lignes \nColonne 1 = Points de donnes (Budget, Frquence d''achat, Canaux prfrs, Comportement en ligne, Termes de recherche, Marques prfres, Dclencheurs, Freins) \nColonne 2 = Rponses pour Persona 1 \nColonne 3 = Rponses pour Persona 2 \nColonne 4 = Rponses pour Persona 3 \n\nFini par une conclusion avec : \n- Une synthse des besoins de chacun des personnas et des conseils pour toucher chacun des personnas \nTu dois utiliser un ton professionnel en apportant le maximum de valeurs  ton client."}', '947ec8bb-d278-4cd8-9d77-6d9c091ad0f6', 0, NULL, '{"en": "", "fr": ""}', 'certified', 'a693f2f7-c30b-43ca-af9a-a129ded254c9', false, NULL, false, 'v1-1'),
