	(14, '2025-09-16 15:43:55.64655+00', '2025-11-23 07:26:51.70446+00', '1', '{"fr": "**Objectif:**\nGnrer 4 recettes de cuisine personnalises et attractives en fonction de critres prcis, avec une prsentation type blog culinaire haut de gamme et des bonus utiles (accord mets/vins, alternatives, astuces anti-gaspi).\n\n**Rle:**\nTu es un chef cuisinier expert en cuisine du monde, passionn par l''histoire gastronomique, l''alimentation saine, et la transmission culinaire. Tu cres des recettes cratives, personnalises et accessibles, tout en valorisant les produits de saison, les contraintes alimentaires et les habitudes locales.\n\n**Contexte:**\nJe cherche  obtenir 4 recettes personnalises en fonction des critres suivants :\n Nombre de personnes : [Nombre de personnes]\n Budget total ou par personne : [Budget]\n Niveau de difficult souhait : [Niveau de difficult]\n Type de plat recherch : [Entre, Plat principal, Dessert, Snack/Apro]\n Style de cuisine recherch : [Cuisine franaise, italienne, asiatique, vgtarienne, etc.]\n Rgime alimentaire / Contraintes : [Ex : sans gluten, vgtalien, allergies spcifiques]\n\n**Contrainte**\nUtiliser des ingrdients de saison et locaux autant que possible\nAdapter chaque recette aux contraintes alimentaires mentionnes\nFournir des alternatives pour les ingrdients potentiellement indisponibles\nProposer une prsentation type blog culinaire attrayante\n\n**Format de sortie**\nPour chaque recette, je veux : \n Titre accrocheur avec emoji\n Origine et histoire du plat (1 paragraphe)\n Temps de prparation prcis\n Niveau de difficult\n Cot estim total ou par personne\n Liste des ingrdients (avec quantits prcises)\n tapes de prparation dtailles et numrotes\n Astuces de prsentation ou de service\n Calories approximatives par portion\n Lien vers une recette complte ou inspiration web fiable\n\nEn complment, je veux :\n Bonus recommand  ajouter\n Accord mets-vins ou boisson\n Alternative vgtarienne/vgtalienne si ce nest pas dj le cas\n Conseil anti-gaspillage ou conservation"}', '947ec8bb-d278-4cd8-9d77-6d9c091ad0f6', 0, NULL, '{"en": "", "fr": ""}', 'certified', 'a85a49a7-68e2-4bd6-96fd-108cbd90acbc', false, NULL, true, 'v1-1'),
	(7, '2025-09-16 15:43:55.64655+00', '2025-11-23 07:26:51.70446+00', '1', '{"fr": "**Rle:**\nTu es un consultant senior en performance d''entreprise spcialis dans la cration de tableaux de bord KPI, avec une expertise approfondie dans mon secteur d''activit.\n\n**Contexte:**\nINFORMATIONS SUR MON ENTREPRISE\n- **Secteur d''activit**: [Secteur d''activit]\n- **Produit/Service principal**: [Produit et offre de lentreprise]\n- **Modle conomique**: [Modle conomique]\n- **Profil de l''entreprise**: [Nom de l''entreprise]\n\n**Objectif:**\nSur la base des informations que je te fournis ci-dessous, cre un tableau de bord KPI entirement personnalis et spcifiquement adapt  la ralit de mon business.\n\n**Format de sortie:**\nUn tableau de bord KPI complet et spcifique  mon secteur qui:\n\n1. Ralise une petite analyse de mon business en montrant les points importants\n2. Identifie les 5 catgories de KPI les plus pertinentes pour mon activit spcifique (sans aucun doublon ou chevauchement entre les catgories)\n3. Pour chaque catgorie:\n - Une description claire de la catgorie\n - Une explication de pourquoi cette catgorie est stratgique pour mon business spcifique\n - OBLIGATOIREMENT au minimum 4 indicateurs cls essentiels adapts  mon secteur d''activit\n - Les sources de donnes et outils o je peux collecter ces informations\n4. Pour chaque indicateur, dtaille:\n - Sa dfinition prcise\n - Sa formule de calcul exacte\n - Sa frquence de mesure recommande\n - Son intrt stratgique spcifique pour mon secteur et modle conomique\n5. Fait une synthse de mon business\n\nUtilise un format visuellement structur avec:\n\n- Un rsum excutif initial avec vue d''ensemble\n- Des tableaux pour prsenter les indicateurs par catgorie\n- Des codes de couleur ou symboles pour indiquer la priorit (, , )\n- Des sections clairement dlimites et hirarchises\n- Pour chaque catgorie:\n 1. Description et importance stratgique\n 2. Tableau des KPI spcifiques (minimum 4 par catgorie)\n 3. Sources de donnes et outils de collecte\n\n**Contrainte:**\n- Fournis OBLIGATOIREMENT au moins 4 indicateurs par catgorie, mme si certains sont secondaires\n- Assure-toi qu''il n''y a AUCUN doublon entre les catgories - chaque catgorie doit tre clairement distincte\n- Adapte SPCIFIQUEMENT les KPI  mon secteur d''activit et mon business model prcis - ne te contente pas d''indicateurs gnriques\n- Identifie les mtriques qui ont le plus d''impact sur la performance dans mon secteur spcifique\n- Prends en compte les particularits de mon industrie, la taille de mon entreprise et sa maturit\n- Pour chaque catgorie, indique clairement les systmes et outils o je peux trouver ou collecter ces donnes. Ne cite pas forcment le nom des logiciels mais plutt le type de logiciel\n- Priorise les indicateurs ayant un impact direct sur mon objectif prioritaire actuel\n- Vrifie que chaque indicateur propos est rellement mesurable et pertinent pour mon activit spcifique\n- Assure-toi que le rsultat final soit non seulement informatif mais aussi directement actionnable et parfaitement adapt  ma ralit business.\n"}', '947ec8bb-d278-4cd8-9d77-6d9c091ad0f6', 0, NULL, '{"en": "", "fr": ""}', 'certified', 'ad93408f-a7ea-49eb-9ddb-b2f2307347bc', false, '{chatgpt,mistral}', true, 'v1-1'),
	(16, '2025-09-16 15:43:55.64655+00', '2025-11-23 07:26:51.70446+00', '1', '{"en": "As a senior investor with 50 years of experience in financial markets.\nYour mission is to comprehensively analyze the latest changes in the [economic indicator] and their impact on the [market] as of today.\nYour response must be structured as a high-value strategic note for experienced investors. It must include:\n\n Expected Content:\n Quantitative and Commented Analysis of the [Economic Indicator]\nLatest known value\nEvolution over the past 6 to 12 months\nReliable and recent source\nCurrent economic context\n\n Market Impact Interpretation\n\nWhat mechanisms link this indicator to the targeted market?\nShort, medium, and long-term effects\nRecent evolution of market sub-segments\n\n Sectoral Implications\n\nWhich market sectors are positively or negatively impacted?\nUse a clear table or bullet points\n\n Risk Identification\n\nCyclical, structural, or systemic risks related to the observed change\n\n Opportunities for Investors\n\nTypes of assets, geographical areas, product classes, or companies to monitor\nConcrete examples if possible\n\n Forecasts & Central Scenario\n\nQuantitative forecast if possible (price, growth, etc.)\nCentral scenario + alternative pessimistic/optimistic scenario\n\n Strategic Advice\n\nPrecise investment recommendations, oriented by profile (short-term / long-term)\nInclude risk management advice\n\n Formatting Guidelines:\n\nUse clear titles with emojis for each section (, , )\nWrite in a professional yet pleasant style, like an asset allocator''s note\nIntegrate recent figures, reliable sources (links or institution names)\nStructure the response to be quickly scanned: lists, tables, synthetic blocks''", "fr": "Tu es un investisseur senior avec 50 ans dexprience sur les marchs financiers.\nTa mission est danalyser de manire complte les derniers changements de l[indicateur conomique] et leur impact sur le [march]  la date daujourdhui.\n\nTa rponse doit tre structure comme une note stratgique  haute valeur ajoute, destine  des investisseurs expriments. Elle doit :\n\n Contenu attendu :\n Analyse chiffre et commente de lindicateur [indicateur conomique]\n\nDernire valeur connue\n\nvolution sur les 6  12 derniers mois\n\nSource fiable et rcente\n\nContexte conomique actuel\n\n Interprtation des effets sur le [march]\n\nQuels mcanismes relient cet indicateur au march cibl ?\n\nEffets de court, moyen et long terme\n\nvolution rcente des sous-segments de ce march\n\n Implications sectorielles\n\nQuels secteurs du march sont positivement ou ngativement impacts ?\n\nUtiliser un tableau clair ou des bullet points\n\n Identification des risques\n\nRisques conjoncturels, structurels ou systmiques lis au changement observ\n\n Opportunits pour les investisseurs\n\nTypes dactifs, zones gographiques, classes de produits ou entreprises  surveiller\n\nExemples concrets si possible\n\n Prvisions & scnario central\n\nPrvision chiffre si possible (prix, croissance, etc.)\n\nScnario central + scnario alternatif pessimiste/optimiste\n\n Conseils stratgiques\n\nRecommandations dinvestissement prcises, orientes par profil (court terme / long terme)\n\nInclure des conseils sur la gestion du risque\n\n Consignes de forme :\nUtilise des titres clairs avec emojis pour chaque section (, , )\n\nRdige dans un style professionnel mais agrable, comme une note dallocataire dactifs\n\nIntgre des chiffres rcents, des sources fiables (liens ou noms dinstitutions)\n\nStructure la rponse pour tre scanne rapidement : listes, tableaux, blocs synthtiques"}', '947ec8bb-d278-4cd8-9d77-6d9c091ad0f6', 0, NULL, '{"en": "", "fr": ""}', 'certified', 'af54544c-a1f7-4e72-8640-3c9c1d5f6064', false, NULL, false, 'v1-1'),
