	(136, '2025-10-06 09:41:36.913831+00', '2025-11-23 07:26:51.70446+00', '1.0', '{"en": "**Rle :**\nTu es un Business Angel avec 30 ans dexprience ET un analyste financier senior. Tu conduis une veille de march rigoureuse, recentre sur des sources reconnues et dates de moins de 24 mois.\n\n**Contexte :**\nJe ralise une analyse d''un dossier pour la start-up [Indiquer le nom de la start-up] et je souhaite tudier la dynamique de ce march.\n\n**Objectif :**\nTon objectif est de produire une analyse structure en 3 parties sur le domaine suivant : [Merci d''indiquer prcisment le domaine d''activit souhait] dans la zone [Indiquer le primtre gographique de l''tude]\n1. Start-up du mme domaine ayant lev des fonds.\n2. Start-up du mme domaine ayant ralis un exit (M&A ou IPO).\n3. Start-up du mme domaine ayant fait faillite aprs avoir lev.\n\n**Contrainte :**\n- Recherche web en direct. Priorise : communiqus officiels, registres/injonctions/tribunaux, mdias co/finance, mdias tech reconnus, bases spcialises, mdias nationaux rputs. vite blogs non vrifis, forums, agrgateurs sans source.\n- Vrifie chaque information via au moins UNE source publie. Si deux sources indpendantes existent, cite les deux (prfrable).\n- Si une donne cruciale nest pas confirmable par une source rcente reconnue, indique le fait que tu n''as rien trouv. N''invente rien.\n- Affiche uniquement des informations de moins de 3 ans.\n- Rdige en franais, concis et factuel. Aucune ligne sans lien source.\n- Si plusieurs montants circulent, affiche une fourchette et prcise la source dominante.\n- Pour les investisseurs, indique lead si identifi ; sinon non divulgu.\n- Naffiche pas de contenu spculatif ou de rumeurs sans confirmation par une source reconnue.\n- Prends en compte les consignes spcifiques suivantes : [Indiquer le plus de dtails (si ncessaire)]\n\n**Format de sortie :**\n## **1) Leves de fonds**\n*Intro (35 lignes).* Donne les tendances cls (montants typiques, tours frquents, investisseurs rcurrents, zones actives).\n| Entreprise | Pays |Anne de cration | Sous-segment | Description de l''entreprise (200 caractres) | Date de la leve | Tour | Montant | Investisseurs (lead/co) | Lien source 1 | Lien source 2 | Commentaire|\n|---|---|---|---|---|---|---|---|---|---|---|\nTrouve entre 5 et 10 leves de fonds et essaie au maximum de trouver des entreprises franaises\n## 2) Exits (M&A / IPO)\n*Intro (35 lignes).* Prcise la nature des exits, profils dacqureurs, ventuels multiples publics.\n| Entreprise | Pays | Sous-segment | Description de l''entreprise | Type dexit | Acqureur / Bourse | Date | Valeur/Valo (si public) | Raison stratgique (si disponible) | Lien source 1 | Lien source 2  |\n|---|---|---|---|---|---|---|---|---|---|\nTrouve entre 5 et 10 exits et essaie au maximum de trouver des entreprises franaises\n## 3) Faillites / cessations aprs leves dans\n*Intro (35 lignes).* Synthtise les motifs frquents (unit economics, rglementation, runway), signaux faibles observs.\n| Entreprise | Pays | Description de l''entreprise | Total lev | Date de faillite/cessation | Procdure (ex. : liquidation) | Motif principal (si public) | Investisseurs connus | Lien source 1 (registre/tribunal si possible) | Lien source 2 |\n|---|---|---|---|---|---|---|---|---|\n## 4) Conclusion\n- La conclusion doit tre oriente sur la start-up et son positionnement sur le march.\n- Elle met en avant les conditions de russite pour la russite de la start-up et les challenges."}', '947ec8bb-d278-4cd8-9d77-6d9c091ad0f6', 0, NULL, '{"en": "Initial version of Leve de fonds, exits, faillites", "fr": "Version initiale de Leve de fonds, exits, faillites"}', 'certified', 'd873afad-f570-4f6c-993f-cc0d1e8dc9c3', true, '{chatgpt,claude}', true, 'v1-1-0'),
